import React from "react";
import AppHeader from "./Header";
import {Container} from "./styles";
import AppFooter from "./Footer";
import {ContentBlock} from "./Content/styles";

const AppLayout = ({children}) => {
    return (
        <Container>
            <AppHeader/>
            <Content>
            {children}
            </Content>
            <AppFooter/>
        </Container>
    )
};

export default AppLayout
